import React from "react";
import { useNavigate } from "react-router-dom";
import { useDispatch } from "react-redux";
import { logout } from "../Redux/userSlice";

// Import images from the 'src/images' folder
import sample from "../Images/sample.jpg";
import employee from "../Images/employee.jpg";
import machine from "../Images/machine.jpeg";
import yarn from "../Images/Yarn.jpg";

const Home = () => {
  const navigate = useNavigate();
  const dispatch = useDispatch();

  // Handle Logout
  const handleLogout = () => {
    dispatch(logout());
    navigate("/login");
  };

  return (
    <div>
      {/* Logout button on top */}
      <button onClick={handleLogout}>Log Out</button>

      <h1>Welcome to the Home Page</h1>

      <div style={{ display: "flex", justifyContent: "space-around" }}>
        <img
          src={image1} // Using imported image
          alt="Page 1"
          style={{ cursor: "pointer" }}
          onClick={() => navigate("/page1")}
        />
        <img
          src={image2} // Using imported image
          alt="Page 2"
          style={{ cursor: "pointer" }}
          onClick={() => navigate("/page2")}
        />
        <img
          src={image3} // Using imported image
          alt="Sample"
          style={{ cursor: "pointer" }}
          onClick={() => navigate("/sample")}
        />
      </div>
    </div>
  );
};

export default Home;
